
import requests
from PIL import Image
import base64
import traceback
from io import BytesIO

def download_img(url, thumbnail=False):
    if "spotify:image:" in url:
        url = url.replace('spotify:image:', '')
    try:
        match url:
            case 'old_home':
                img_data = base64.b64decode(old_home)
            case 'carthinghax_logo':
                img_data = base64.b64decode(carthinghax_logo)
            case _:
                img_data = requests.get(url).content
        
        img_data = BytesIO(img_data)
        img_out = BytesIO()
        img = Image.open(img_data).convert("RGB")
        w, h = img.size
        if thumbnail:
            w, h = (96, 96)
            img=img.resize((96,96))
            print("resize")
        elif (w>300) & (h>300):
            w, h = (300, 300)
            img=img.resize((300,300))
        img.save(img_out, format="JPEG")
        img_b64 = base64.b64encode(img_out.getvalue()).decode('utf-8')

        resp = {'image_data': img_b64, 'width': w, 'height': h}
        return resp
    except Exception:
        print("\n\n~~~~~ Exception Start ~~~~~")
        traceback.print_exc()
        print("~~~~~  Exception End  ~~~~~\n")




